(40,	'20% Off The Total Bill',	'Dhow and Anchor, known as D&A, is a modern, award-winning British gastropub offering contemporary British cuisine. For those who wish to dine al fresco, D&A offers a large terrace area with a panoramic view of Burj Al Arab Jumeirah and the surrounding gardens.\r\n\r\nDhow and Anchor are offering a 20% discount off the total bill to all TDG members. Discount valid everyday for up to a maximum of 6 guests. Discount excludes Happy Hour and any other F&B promotions.',	5,	'bUKIwTTjmNCzSBXo6zM8arGCtuoVlGEnFR3NsEQ0.png',	23,	'Present ID to redeem discount',	'2021-01-08 12:01:57',	2,	'2021-01-08 12:01:57',	'2021-01-26 07:48:11'),
(48,	'20% Off All Hair Services',	'Tito & Tuthill pride themselves on ensuring that the client always comes first, believing that a thorough & full consultations are the foundations of success. The salon pride themselves on having a team with genuine passion to get the best results.Tito & Tuthill create a unique and personally tailored experience for each and every client. \r\n\r\nTito & Tuthill are offering 20% off all hair services from Saturday to Wednesday.',	2,	'dgApFRfaz8QDmPPASoJmkb2U5Z6J4bmrErkVF7iF.png',	24,	'Present ID to redeem discount',	'2021-01-08 01:05:47',	1,	'2021-01-08 13:05:47',	'2021-01-25 06:39:59'),
(49,	'10% Off All Services',	'Luxe Incorporations is run by a passionate businesswoman specialising in female empowerment, women in business and entrepreneurship. Their goal is to help structure successful businesses and help client\'s network and collaborate. They provide tailored services to enable you to structure your business or freelance platform and maximise your business potential and can provide you with a full overview of the current market options suitable for your business. \r\n\r\nAs part of the TDG collaboration Jenna is offering any TDG girls requiring these services 10% off her services!',	13,	'0WYTSry1RLvRo8hzrSK0wzlIU35SlJY7ybQ99gM8.png',	25,	'Present ID to redeem discount',	'2021-01-08 01:17:11',	1,	'2021-01-08 13:17:11',	'2021-01-25 06:40:06'),
(50,	'25% Off The Total Bill',	'Sip cocktails with friends or savor contemporary sharing food in this rooftop lounge, bar and restaurant overlooking the Arabian Gulf. With two expansive terraces, Pure Sky Lounge & Dining is an idyllic setting to watch the sunset in a chic and modern ambience. Be sure to try the sharing dessert, plated at your table by one of their skilled chefs.\r\n\r\nEnjoy 25% off your bill, Sunday - Thursday. Discount valid everyday for up to a maximum of 4 guests.\r\n\r\nLadies you\'re encouraged to join Eat, Drink and Save loyalty program  - Find out more at https://www.hilton.com/en/p/eat-drink-save/',	5,	'VkX5wcNSfE1xGgyMF4zOQQ2HcMn6g5GjHAQArHnB.png',	26,	'Present ID to redeem discount',	'2021-01-08 04:25:37',	1,	'2021-01-08 16:25:37',	'2021-01-26 07:46:31'),
(51,	'Ladies Night Offer- Every Night',	'Sip cocktails with friends or savor contemporary sharing food in this rooftop lounge, bar and restaurant overlooking the Arabian Gulf. With two expansive terraces, Pure Sky Lounge & Dining is an idyllic setting to watch the sunset in a chic and modern ambience. Be sure to try the sharing dessert, plated at your table by one of their skilled chefs.\r\n\r\nMembers of TDG have an exclusive deal at Pure Sky Lounge – ladies night, EVERY night! The ladies night deal at Pure Sky Lounge is AED 129 per lady for 3 house infused gin cocktails and bar bites. This deal is only available at the venue on Wednesday\'s but members of TDG can have it every week night, Sunday to Thursday.',	5,	'E8a0ozxAUKiHJHP60LM6nkwwuvhfNe5588zT9Wlh.png',	26,	'Present ID to redeem discount',	'2021-01-08 04:33:34',	1,	'2021-01-08 16:33:34',	'2021-01-26 07:46:39'),
(52,	'20% Off Class Packages',	'Barry\'s is known as The Best Workout in the World™®. Founded in West Hollywood in 1998, it’s the original strength and cardio interval fitness experience that provides a dynamic, high-intensity workout that’s as effective as it is fun.  Our fitness classes alternate between working out with weights and running on a treadmill and each day focuses on different muscle groups in order to achieve real results and to help reduce the risk of injuries.\r\n\r\n20% off on package of 5,10 & 25 classes, purchase in studio only. Package not shareable. Package valid for 1 year after purchase. Available in both Dubai Marina and DIFC branches.',	14,	'isJXWUxmGC76JA9SsgXn9F4Xxx0eQWdMqBNoCa9W.png',	27,	'Present ID to redeem discount',	'2021-01-08 04:46:27',	1,	'2021-01-08 16:46:27',	'2021-01-26 07:46:51'),
(53,	'10% Off Boutique Beds',	'Dixie\'s Boutique are a luxury dog bed company who build all their designs from scratch within the UAE. They offer full customisations on all products i.e. size, name embroidery, colours, material and you can even design your own bespoke dog bed. They also build custom made dog ramps for your bed!\r\n\r\nDixie\'s Boutique are offering 10% off all their boutique beds (Not applicable on the medicated dog bed or sale items.)\r\n\r\nFor customised orders, please reach out to Dixie\'s Boutique directly.\r\n​',	3,	'ZtG2HEhNZiqyKR9TpxUC1amY38MdGbPHKVbNwKmI.png',	57,	'Use code TDGDIXIE10 at checkout',	'2021-01-13 06:10:05',	1,	'2021-01-13 06:10:05',	'2021-01-27 08:40:54'),
(54,	'10% Off Services',	'Willow Lane are one of Dubai’s favourite boutique style salons helping you to stay effortlessly fabulous and fierce! They provide their visitors with a calming oasis, complete with a neutral colour scheme and green foliage. Their team of UK-trained professionals are on hand to provide services such as hair, nails, lashes, brows, waxing and much more.\r\n\r\nWillow Lane are offering 10% off all beauty services every day and selected hair services and stylists.',	2,	'lSRK9LcjxU6p4keqiBPYRMpEAWYZ9QFr7c5v76Z2.png',	44,	'Present ID to redeem discount',	'2021-01-13 07:43:04',	1,	'2021-01-13 07:43:04',	'2021-01-25 06:40:49'),
(55,	'1 Month Free',	'Treats Card are an application that offers up to 50% off on all your pet spending. They have over 140 offers on services such as Vets, Grooming, Daycare, Food, Pet Friendly Restaurants and so much more! They also offer priority reservations and provide exclusive member-only discounts at their monthly treats card events.\r\n\r\nTreats Card are offering 1 month free to all TDG members.',	3,	'Y8sWnefDAnUSoR3IF3pcBXl2LFkj4Qz17TtcZagX.png',	35,	'Use code TDGFREE at checkout',	'2021-01-13 08:07:51',	1,	'2021-01-13 08:07:51',	'2021-01-25 07:06:32'),
(56,	'20% Off First Custom Suit',	'Suited and Booted offer an exclusive luxury experience throughout your personal tailoring journey. Their in-depth knowledge and extensive suiting expertise are second-to-none and they are at the top of the luxury tailoring sector in the UAE. Their dedicated team are constantly adapting, researching and pushing boundaries to stay ahead of latest global trends and local style alongside modern takes on the classic silhouette; combining modern-day aesthetics with the classic virtues of British tailoring.\r\n\r\nSuited and Booted are offering 20% off your first custom made suit to all TDG members.',	13,	'DHvlimsgFbwzKzyV54Lo5NLX85XMdu3so17T6m6m.jpeg',	51,	'Present ID to redeem discount',	'2021-01-13 08:14:37',	1,	'2021-01-13 08:14:37',	'2021-01-25 06:34:16'),
(57,	'15% Off Any Purchase',	'LOXX are an affordable, non-damaging solution to creating big hair! 200grams of soft, luxurious synthetic hair sit across a single piece of lace attached to 5 easy-to-snap clips. Simply clip-in and clip-out whenever you would like maximum drama, in either soft curl or blow dry straight. Or go for the ponytail with its effortless drawstring action for a thick and bouncy pony in seconds!\r\n\r\nLOXX are offering all TDG members 15% off.',	3,	'QuFVOXwnT5PsK13thtgWcrup3INCAol38HaRjbSJ.png',	56,	'Use code TDG15 at checkout',	'2021-01-13 08:20:59',	1,	'2021-01-13 08:20:59',	'2021-01-25 07:07:23'),
(58,	'15% Off The Total Bill',	'“Mahec\" means aroma in Hindi and the name truly reflect the restaurants concept to captivate the diners with the excellent food, music and ambience – offering the ultimate dining experience. Mahec combines traditional recipes dating back centuries with modern palettes and styles. The rich flavors of India take a new meaning at Mahec. Seeped in culinary history going back centuries, this Indian restaurant in Dubai offers authentic Indian cuisine presented in a distinctively modern style.\r\n\r\nMahec are offering 15% off the total bill on Mondays, Wednesday’s and Saturdays. Discount valid everyday for up to a maximum of 4 guests.',	5,	'kz00g5YRNNS0TyHZfWJlAvJMa6XFKoKbaFREejgF.png',	36,	'Present ID to redeem discount',	'2021-01-13 09:45:01',	1,	'2021-01-13 09:45:01',	'2021-01-25 10:25:27'),
(59,	'10% Off Yacht Hire',	'Dubai Key\'s sole aim is to provide clients with guidance on the best that Dubai has to offer. Primarily, this will include (but not limited to) Restaurant recommendations and bookings, desert safaris, Private Yacht Rentals, Beach Club recommendations & bookings, as well as other special events (e.g. Abu Dhabi Grand Prix, Dubai World Cup). Their service is end-to-end, meaning that they aim to relieve the stress of any part of the holiday planning experience. Clients can rely on them to make informed recommendations, and will never disappoint.\r\n\r\nDubai Key are offering 10% off yacht hire for TDG members.',	7,	'P355tW72Lw70BMBrQEBbJcXOeFuMNSDYzTM7nYRL.png',	40,	'Present ID to redeem discount',	'2021-01-13 09:49:35',	1,	'2021-01-13 09:49:35',	'2021-01-25 06:43:44'),
(60,	'10% Off All Purchases',	'Buy it now. Get it now. Discover your favourite beauty, lifestyle and health brands on the bgX App. All Delivered to you in just 30 minutes across the UAE!  They are the perfect solution for your beauty needs or last minute gifts! Shop from some of their best brands such as Olaplex, Dr. Barbara Sturm, Anastasia Beverly Hills and Naked Tan.\r\n\r\nbgXare are offering 10% off all purchases for TDG members.',	3,	'YxwiWZoPyCunwWOTbtOK3gOSbvVRCThHCbUCkxTo.jpeg',	59,	'Use code GIRL10 at checkout',	'2021-01-13 09:56:21',	1,	'2021-01-13 09:56:21',	'2021-01-25 08:45:06'),
(61,	'10% Off Purchases And Event Tickets',	'Magic of Being are a body-positive and inclusive holistic self care brand that believes life is magical and so are you. Based in Dubai, the brand encompasses an online destination with the tools, tips, and resources to help women step into their most powerful selves. In addition to a soon-to-open self-care and lifestyle boutique, they also host monthly healing circles and other interactive events and workshops designed to inspire and empower, both online and in person.\r\n\r\nMagic of Being are are offering 10% off for TDG members.',	3,	'PxKf4nu0OlGS8yPwn4dqs1fE52IlrCDdkx6bvGi1.png',	38,	'Use code MOBXTDG at checkout',	'2021-01-13 10:01:13',	1,	'2021-01-13 10:01:13',	'2021-01-25 09:05:03'),
(63,	'50% Off Hair Services',	'The Perfect Blend Dubai are the one stop shop for all of your hair and beauty  needs that will make you never want to leave! They are a team built up on talented British hairdressers with many years experience between the UK and Dubai. They specialize in balayage, colour corrections, funky colours and beauty works hair extensions.\r\n\r\nIn February, The Perfect Blend are offering 50% off all hair services (excluding hair Extensions). This offer can only be used on one hair service per visit.',	2,	'gixmlTnIws262oalgpRHKfcpjaGx70FgQPpu33xD.png',	54,	'Present ID to redeem discount',	'2021-01-13 10:29:17',	1,	'2021-01-13 10:29:17',	'2021-01-26 07:47:06'),
(64,	'30% Off All Purchases',	'Sasha & Jo Bracelets is a Dubai based online jewellery store. We want to be different from other brands by not only offering affordable trendy bracelets but also engaging with our loyal customers with our exciting Sasha & Jo Club and coming soon Brand Ambassador program. \r\n\r\nSasha & Jo are offering 30% off all purchases for TDG members. Minimum spent 150 AED (excluding shipping cost), this offer can\'t be used in conjunction with any other offers - 6 months validity.',	3,	'kG2XWqlC0Ti6msbRf2aPGuVDRfcEDvLjJtol8sA8.jpeg',	61,	'Use code DXBTDG30 at checkout',	'2021-01-13 10:32:10',	1,	'2021-01-13 10:32:10',	'2021-01-27 07:48:29'),
(65,	'15% Off All Purchases',	'The Aloe Vera Company (Forever Living Products) has been around 42 years and operating in 160 countries. All products are made with their patented Aloe vera. They have products in skincare, weight management, personal care and nutrition. These products are distributed through home business owners only. \r\n\r\nYvesforever - a distributor of Forever living products - are offering a 15% discount off all products to TDG members when placing orders of Forever Living products by phone orders placed to Yvonne.',	3,	'iOmBwivESZqpnWZC6azframbFllAzsckeSCQZqnz.png',	58,	'Quote TDG15 via phone orders',	'2021-01-13 10:41:31',	1,	'2021-01-13 10:41:31',	'2021-01-28 07:36:43'),
(66,	'25% off Twist & Turn Saturday Brunch',	'Introducing the new Saturday Brunch Twist & Turn from Seven Sisters & LUV Events. Indulge in a fiery mix of Afrobeats & Commercial music brought to you by International Award Winning Scottie B & Taya Kruzz.\r\n\r\nFrom 2pm till 6pm, benefit from:⁣⁣\r\n250 AED - Food & Soft Drinks⁣⁣\r\n350 AED - Food & Regular Alcoholic Package⁣⁣\r\n450 AED - Food & Premium Alcoholic Package⁣⁣\r\n\r\nAfter brunch package, 200 AED for unlimited selected drinks between 6pm - 8pm. Food ordering is mandatory for now.⁣⁣\r\n\r\nPlease book early!\r\n\r\nHosted by LUV Events and Panache.',	5,	'gdtWMZLpcGqeQf0QkCqx5T8pNSWKFbO18s24jHtb.png',	62,	'Present ID to redeem discount',	'2021-01-13 12:10:22',	1,	'2021-01-13 12:10:22',	'2021-01-25 06:41:07'),
(67,	'Ladies Night Package',	'Pure Sky Lounge is a chic and modern lounge, bar and restaurant located on the 35th floor of Hilton Dubai The Walk Hotel, in Al Bahar, JBR.\r\nWith indoor and outdoor seating areas Pure offers a bird’s eye views over the beach, sea and the Palm Jumeirah.\r\n\r\nPure Sky Lounge are offering all TDG members a ladies night package any night of the week!',	5,	'Q9YqGgDERlbkbVWQTjeO03MfbNxtIZ1wsXiG6R9Y.png',	26,	'Present ID to redeem discount',	'2021-01-13 12:25:09',	1,	'2021-01-13 12:25:09',	'2021-01-25 06:45:33'),
(68,	'25% Off The Total Bill',	'Trader Vic’s is a family of restaurants located in 17 countries across the globe. Taste The World through exotic cuisines and imbibe from a collection of over 200 Trader Vic’s signature cocktails at the Home of the Original Mai Tai.\r\n\r\nTrader Vic\'s are offering 25% of the total bill to all TDG members Sunday-Thursday. Discount valid everyday for up to a maximum of 4 guests.',	5,	'DwNUsySreJ12ugo3bHTHqtAvejeZpcpPdFZ9eGB1.png',	29,	'Present ID to redeem discount',	'2021-01-13 12:33:11',	1,	'2021-01-13 12:33:11',	'2021-01-25 10:26:36'),
(69,	'50% Off The Total Food Bill',	'Located in Club Vista Mare, Palm Bay is the place to be if you are into Caribbean inspired atmosphere. The inside dining area is trendy and colourful whilst the beachfront area is a natural beauty on its own. The cool vibe is made even better by their delectable menu and selection of house beverages.\r\n\r\nPalm Bay are offering 50% off the food bill to all TDG members Sunday-Wednesday. Discount valid all day for up to a maximum of 4 guests.',	5,	'SY8Qf5gih08A69EaYpWKYYgXLIrqtbdZWop2e6pE.png',	31,	'Present ID to redeem discount',	'2021-01-13 12:47:45',	1,	'2021-01-13 12:47:45',	'2021-01-27 06:42:06'),
(70,	'15% Off The Total Bill',	'Located in Club Vista Mare, Palm Bay is the place to be if you are into Caribbean inspired atmosphere. The inside dining area is trendy and colourful whilst the beachfront area is a natural beauty on its own. The cool vibe is made even better by their delectable menu and selection of house beverages.\r\n\r\nPalm Bay are offering 15% off the total bill to all TDG members every Saturday. Discount valid up to a maximum of 4 guests.',	5,	'tZVFFSlql5xx99zjbBQM50Z9BEykdoRRTiU4jrzP.png',	31,	'Present ID to redeem discount',	'2021-01-13 12:52:30',	1,	'2021-01-13 12:52:30',	'2021-01-27 06:40:51'),
(71,	'15% Off All Purchases',	'Hi Maintenance is a glamorous online fashion boutique based in Dubai. They are the go-to for luxurious and affordable party dresses, evening wear, cute brunch outfits, and much more! Sizes range from UK 6 – 18 and collections include a Luxe Collection for extra glam, red carpet ready looks and a Curve Collection for the curvy ladies. Step out in style, step out in Hi Maintenance!\r\n\r\nSame day delivery is available in Dubai and next day delivery for the rest of the UAE. \r\n\r\nHi Maintenance are offering 15% off to all TDG members when ordering online. Click redeem to find your exclusive TDG discount code.',	3,	'kG8mKgh8sunMbidxqCICvjOuTUn06Bg9Uqe0YL9H.png',	32,	'Use code TDG15 at checkout',	'2021-01-13 12:56:11',	1,	'2021-01-13 12:56:11',	'2021-01-28 04:53:18'),
(72,	'50% Off All Beauty Services',	'The Perfect Blend Dubai is a one stop shop for all of your hair and beauty needs that will make you never want to leave! They are a team built up on talented British hairdressers with many years experience between the UK and Dubai. They specialize in balayage, colour corrections, funky colours and beauty works hair extensions.\r\n\r\nIn February, The Perfect Blend are offering 50% off all beauty services. This offer can only be used on multiple beauty services per visit.',	2,	'mLPHt7FTwVhNH8WZ6BSkapuWdfxR7TpfZh4vszPU.png',	54,	'Present ID to redeem discount',	'2021-01-13 01:01:15',	1,	'2021-01-13 13:01:15',	'2021-01-25 06:44:49'),
(73,	'15% Off Everything',	'Padel Pro is the leading Padel club in the United Arab Emirates. Based in Jumeirah Lakes Towers (Sportsmania), they offer state-of-the-art courts for bookings, High-Quality Match Making Services, Packages, Private or Group Coaching, Tournaments, Academies, & Merchandise for experienced or new Padel players of all ages. They also offer project management and consulting services for those interested in building private courts.\r\n\r\nPadel Pro are offering a 15% discount to all TDG members.',	14,	'Od0LN16RBvLG6SlBh6Kh3Ax5cZE2TN68WXNz7Kki.png',	48,	'Present ID to redeem discount',	'2021-01-13 01:04:43',	1,	'2021-01-13 13:04:43',	'2021-01-25 06:44:38'),
(74,	'Ladies Night Package',	'Miss Tess is an asian street food restaurant inspired by a story on an asian woman who grew up in the streets of her continent, learning what they offer best and turning this knowledge into a fully Asian gastronomical experience. Go and meet Miss Tess and enjoy the best street delicatessen, the Asian way!\r\n\r\nMiss Tess are offering all TDG members the following discount:\r\n\r\nEvery Monday\r\n6pm - 2am (All Night Long)\r\nAED98 = 4 Drinks + Platter\r\nShibuya gave birth to Ganguro & Harajuku fashion, a rebellious way to challenge traditional forms of beauty across all of Japan. Miss Tess is bringing this creative district to you every Monday! Get ready for fun and Asian madness with surprises around every corner…\r\n\r\nThe a la carte menu is also available.',	5,	'81ujm1NC2zEWpFMz9nFavczpGMCi9aZQx5m9KVcP.png',	50,	'Present ID to redeem discount',	'2021-01-13 01:24:31',	1,	'2021-01-13 13:24:31',	'2021-01-25 06:44:28'),
(75,	'30% Off The Total Bill',	'Relax at Radisson Red\'s rooftop pool area, with a seating area, lounge chairs, and a menu of poolside-perfect bites. Choose from a selection of nutritious sandwiches and salads alongside more indulgent options and a menu of cocktails, spritzers, and freshly-made smoothies to boot. With views across Dubai’s glitzy Digital Park and a live DJ and entertainment on select nights, RED Roof should not be missed.\r\n\r\nRed Roof are offering 30% off the total bill for all TDG members. Discount valid everyday for up to a maximum of 4 guests.',	15,	'3P5WQFXM0dTmYExEHkCWfM5tb53rO3j3rxJgccru.png',	70,	'Present ID to redeem discount',	'2021-01-14 10:23:00',	1,	'2021-01-14 10:23:00',	'2021-01-27 05:46:24'),
(76,	'30% Off The Total Bill',	'Visit OUIBar + Terrace at street level for a mix of local and international dishes, all prepared with local ingredients. Casual and cozy, this restaurant is the perfect entry point to Dubai, with a mix of live grills packed with bold flavors next to international classics made to please the pickiest of eaters. Choose between indoor and outdoor seating and look out for live music, sport and entertainment nights in one of Dubai’s most happening venues.\r\n\r\nOUIBar are offering 30% off the total bill for all TDG members. Discount valid everyday for up to a maximum of 4 guests.',	5,	'359QSs3jVoZD9AyOdPzvUqZnGCWA2FwqLMwd6fVm.png',	72,	'Present ID to redeem discount',	'2021-01-14 10:25:21',	1,	'2021-01-14 10:25:21',	'2021-01-25 10:25:55'),
(77,	'20% Off The Total Bill',	'Perfect for a gathering with friends, Coco Lounge is a relaxed poolside shisha lounge for the fashion conscious and glamorous. At night, the scene changes to an elegant, upscale social venue, perfect for a fun night out!\r\n\r\nCoco Lounge are offering 20% off for all TDG members, everyday! \r\n\r\nNot valid in conjunction with other offers and promotions, valid on A La Carte only. Valid for a maximum of 4 guests.',	15,	'UuMrq7ASJRUBAoEbYqsx6NepvGlAKRSXqmYhma0b.png',	64,	'Present ID to redeem discount',	'2021-01-14 10:34:07',	1,	'2021-01-14 10:34:07',	'2021-01-25 06:47:03'),
(78,	'20% Off The Total Bill',	'With a menu of filling favourites and a soundtrack of modern classics, Qwerty at Media One is the perfect place to quench and munch for those living and working in and around Dubai Media City.\r\n\r\nQwerty are offering 20% off for all TDG members, everyday! \r\n\r\nNot valid in conjunction with other offers and promotions, valid on A La Carte only. Valid for a maximum of 4 guests.',	5,	'iUbHUmhzisDJM2IgWQ3L7VxyTfx0o1pEvKGibzNO.png',	66,	'Present ID to redeem discount',	'2021-01-14 10:38:57',	1,	'2021-01-14 10:38:57',	'2021-01-28 10:02:44'),
