(82,	'Free Upgrade To Sparkling Brunch Package',	'Your Thursday nights are sorted! Introducing La Dolce Vita, evening brunch at Certo. Enjoy an evening with live music, free-flowing beverages & a wide array of Italian deliciousness served to your table including antipasti, pizza, live pasta station, main courses and dessert platter.\r\n\r\nWhen: Thursdays, 7:30pm – 10:30pm\r\nAED 199 with soft drinks\r\nAED 299 with house beverages\r\nAED 349 with sparkling\r\n\r\nFREE upgrade to sparkling package (when you buy the house package) to all TDG members.',	5,	'wjaW53j7mt9Oz9hww25ssKlzq6AFruXXK2CmxeIL.png',	73,	'Present ID to redeem discount',	'2021-01-14 11:34:16',	1,	'2021-01-14 11:34:16',	'2021-01-25 06:46:26'),
(83,	'Buy 3 Get 1 Free Roast Package',	'The \'Lions Share\' British Roast Packages (1PM - 5PM!)\r\nHave a feast fit for a \'Tipsy Lion\' with our \'Lions Share\' S̶u̶n̶d̶a̶y̶ Saturday Roast,\r\n\r\n🦁 99AED - with 3 Soft Drinks\r\n🦁 149AED - with 3 Cocktails or Beers\r\n🦁 + Spirit Bottles Available at -30% Discount!\r\n\r\nThe Tipsy Lion are offering 4 roasts packages for the price of 3 to all TDG members.',	5,	'qw8TaN9ET3K1AyEi3PFcVB9gQb02ECKD3nrgpsnh.png',	49,	'Present ID to redeem discount',	'2021-01-14 11:40:27',	1,	'2021-01-14 11:40:27',	'2021-01-25 06:46:16'),
