(85,	'15% Off All Purchases',	'Dios Dubai is a locally born sportwear brand created for those who live beyond the limit. Those who push further, outrun, outreach, surpass and triumph. We are bold, we are turning heads and we are achieving greatness. A force to be reckoned with, the ultimate divinity! Join #TheHighestForce!\r\n\r\nDios are offering 15% off to all TDG members.',	3,	'hEw3lYs3dQ4J18dWogUyOughCLNCHf3aDIaBeNYF.png',	75,	'Use code DIOSXTDG15 at checkout',	'2021-01-14 01:45:20',	1,	'2021-01-14 13:45:20',	'2021-01-25 07:07:39'),
(86,	'50% Off The Dirty Friday Brunch',	'Priced at AED 399 per person you can get your hands dirty with this new brunch; enjoy ICON Bar’s signature dirty delights served sharing style; from all you can eat starters to trays with Burgers, Sticky ribs, Chili mussels and dirty fries. As for the beverages enjoy boozy shakes and ICON cocktails, huge desserts made for sharing is also on the menu – live music is on from 2pm – 5pm.\r\n\r\nSoft drinks AED 299 per person\r\nHouse beverages AED 399 per person.\r\nFriday, 1pm – 4pm.\r\n\r\nICON Bar are offering 50% off our brunch package to all TDG members.',	5,	'nrzO7eLW3q07QEZ7TwDRhQbInB215ck6ooZZmwgg.png',	74,	'Present ID to redeem discount',	'2021-01-14 01:50:39',	1,	'2021-01-14 13:50:39',	'2021-01-25 06:45:43'),
(87,	'15% Off Dental Treatments',	'Palmyra Dental Clinic in Jumeira Lakes Towers is a private Dental Clinic in United Arab Emirates, Dubai and our dentists, dental therapists, endodontists, orthodontists, hygienists, nursing and support staff work as a team to offer a full range of cosmetic dentistry and general dental treatments and provide oral hygiene advice to enable our patients to maintain a beautiful smile.\r\n\r\nPalmyra dentists are offering scaling and polishing with stain removal for 150AED and Fluoride for 100AED. All other dental treatments have a15% discount.\r\n\r\nBe sure to request Dr Lina if you are more comfortable with a female dentist.',	8,	'3W5p9AtaZ0TK7Axd14nNCLR8qDehmbB3cVtc35wi.png',	77,	'Present ID to redeem discount',	'2021-01-17 05:30:02',	1,	'2021-01-17 05:30:02',	'2021-01-27 11:26:31'),
(88,	'Free Trail Session',	'Infinite SKI is a place for learning, training and having fun all in the comfort of a pleasantly warm environment. The 2 state-of-the-art Maxxtracks indoor ski slopes will progress your ski or snowboard skills faster than ever before. At infinite SKI, the speed of the belt and the angle of the slope are adjustable to suit the skill of every skier.\r\n\r\nFor all TDG, Infiniti Ski are offering a free trail for Skiing/Snowboarding, Fitness Classes or Hip Hop Dance.\r\n\r\nPlease note, all members must sign their standard waiver.',	7,	'rgInrpPFODi2rZBET2q5uIaFDamFS6JgOUb8RHla.png',	53,	'Present ID to redeem discount',	'2021-01-17 06:24:43',	1,	'2021-01-17 06:24:43',	'2021-01-27 05:45:17'),
(89,	'10-25% Off Sessions',	'Infinite SKI is a place for learning, training and having fun all in the comfort of a pleasantly warm environment. The 2 state-of-the-art Maxxtracks indoor ski slopes will progress your ski or snowboard skills faster than ever before. At infinite SKI, the speed of the belt and the angle of the slope are adjustable to suit the skill of every skier.\r\n\r\nPlease see below a list of their exclusive TDG offers:\r\n- 10% off 1 session\r\n- 15% off 5 sessions\r\n- 20% off 10 sessions\r\n- 25% off 20 sessions\r\n- 25% off group sessions - full class (per person)\r\n- 10% off monthly memberships\r\n\r\nPlease note, all members must sign their standard waiver.',	7,	'giw2ZppSEoWJKGV2gnRkGSAzZoWNxLMQA6ZF2m8t.png',	53,	'Present ID to redeem discount',	'2021-01-17 07:37:18',	1,	'2021-01-17 07:37:18',	'2021-01-27 05:46:12'),
(90,	'Complimentary Ladies Night Drink',	'Larte, the Italian neighbourhood bistro, serves up Milanese cuisine overlooking the hotel’s courtyard and pool. The modern interiors are designed with art in mind, aiming to attract the Studio City’s hub of young creative talent.\r\n\r\nCiao Bella Ladies Night at Larte - Every Tuesday from 6pm; ladies can enjoy 3 drinks & choice of pizza, pasta or risotto for AED99.\r\n\r\nTerms & conditions for both ladies nights:\r\n- Use code TDG when making the booking\r\n- 1 complimentary drink will be valid on the night only\r\n- The Ladies night package must be bought to avail this offer',	5,	'S3xbndnbxobvEUgUt9Z3iCbfPkokXmBdbQHhzvj6.png',	69,	'Present ID to redeem discount',	'2021-01-17 11:11:40',	1,	'2021-01-17 11:11:40',	'2021-01-25 07:02:15'),
(91,	'Complimentary Ladies Night Drink',	'The Void is a new neighbourhood hangout with up-cycled urban decor, daily drinks deals, shisha and a barbecue menu. It\'s found on the third floor terrace of Studio One Hotel and has an industrial, contemporary decor, with a bright colour palette, The Void appeals to fun-loving residents of all ages!\r\n\r\nRock the Block at The Void - every Wednesday from 6pm - ladies can enjoy a platter of bites (including chicken wings, avocado fritters, sliders, stuffed naan)  and 3 drinks for AED99\r\n\r\nTerms & conditions for both ladies nights:\r\n- Use code TDG when making the booking\r\n- 1 complimentary drink will be valid on the night only\r\n- The Ladies night package must be bought to avail this offer',	5,	'dsJbyXaZ9kAUnsLEJKu5CRGNghQaDSuIAMjr2ap8.png',	71,	'Present ID to redeem discount',	'2021-01-17 11:16:45',	1,	'2021-01-17 11:16:45',	'2021-01-25 07:02:05'),
(92,	'20% Off Cocktails',	'The Pangolin is a one of a kind lifestyle destination with a focus on the community spirit and connecting people through good food. The purpose-built complex is an extension of The Els Club in Dubai Sports City and is made up of The Lowlands, a ground floor restaurant and casual bar that is open all day for breakfast, lunch and dinner, as well as a deli with home-grown produce, and on-site bakery. The Highlands, Pangolin’s first-floor restaurant, stunning bar, and terrace with open BBQ is also the perfect place to relax and unwind with friends and family. Inspired by family feasting and traditional cooking methods, The Pangolin works with local farmers and sustainable produce to serve a menu with real heart and soul and is consistently good value for all.\r\n\r\nThe Pangolin Restaurant & Lounge are offering 20% off cocktails (Tues-Thurs).',	5,	'GkyRatRLMym9JB80iLGfGMe7jwXch8cGtYomsauC.png',	52,	'Present ID to redeem discount',	'2021-01-18 10:10:33',	1,	'2021-01-18 10:10:33',	'2021-01-28 05:40:13'),
(93,	'20% Off Dermaplaning and Massages',	'Where you can come to escape, relax and rejuvenate. Built on a passion for exceptional results, NR Beauty bring the worlds leading brands, treatments and technologies to the region through their Salon in Dubai.\r\n\r\nNRBeauty are offering 20% off Dermaplaning and Massage on Sunday, Tuesday and Thursday.',	2,	'vQSmwDitEoviuMCuQ9cPH0yiNwknKHT53BN188nF.jpeg',	39,	'Present ID to redeem discount',	'2021-01-18 01:57:37',	1,	'2021-01-18 13:57:37',	'2021-01-28 06:22:02'),
(94,	'10% Off Desert Experiences',	'Dubai Key\'s sole aim is to provide clients with guidance on the best that Dubai has to offer. Primarily, this will include (but not limited to) Restaurant recommendations and bookings, desert safaris, Private Yacht Rentals, Beach Club recommendations & bookings, as well as other special events (e.g. Abu Dhabi Grand Prix, Dubai World Cup). Their service is end-to-end, meaning that they aim to relieve the stress of any part of the holiday planning experience. Clients can rely on them to make informed recommendations, and will never disappoint.\r\n\r\nDubai Key are offering 10% off desert experiences for TDG members.',	7,	'PFsZ3QpDA5vouklek0Ht70WGBftXw6iBQCUKNRcM.png',	40,	'Present ID to redeem discount',	'2021-01-19 05:31:47',	1,	'2021-01-19 05:31:47',	'2021-01-25 07:01:38'),
