(101,	'15% Off Meal Plans',	'Love Food is a UAE based healthy‍‍‍ meal delivery service. Their main aim is to deliver great food and provide UAE with healthy, nourishing meals that are not only convenient and affordable but pack a massive nutritional punch. They offer delivery on a daily basis (excluding the weekends) to assist with all your weight loss goals. Their highly qualified Australian Chefs cook with the freshest local organic produce, free range and grass fed meats. \r\n\r\nLove Food are offering a 15% discount off 20 day meal plans for all TDG members.',	13,	'KBQ4Gn86bNqRGXhF70cX6sfw62thb91tSm0fkoOQ.png',	79,	'Use code TDGLOVE in the comment',	'2021-01-20 09:21:42',	1,	'2021-01-20 09:21:42',	'2021-01-25 07:08:58'),
(102,	'10% Off Everything',	'FIT BOX is a stylish, compact home and travel workout solution aimed at women of all ages and levels of strength and fitness. In the box, you will find all the tools you need to work towards your health and fitness goals in style along with a 2 week kick-starter workout program designed by Personal trainer and founder Jen Towers. There is also access to other workout programs on the website, personal training with Jen and empowering group classes.\r\n\r\nFIT BOX are offering 10% off everything to TDG members.',	14,	'jbGZxvR6ByyYK9xEefEieLkfd1xAtw2pRjgY7VgI.png',	41,	'Use code TDG10 at checkout',	'2021-01-20 11:06:12',	1,	'2021-01-20 11:06:12',	'2021-01-25 07:08:39'),
(103,	'$10 Off The Program',	'Almost Plant Based 21-Day Weight-Loss Challenge provides you with clear guidelines & a schedule how to lose weight and educates you on the right foods to eat so the weight stays down. You will own your health again. Start anytime and get lifetime access to videos, voice over presentations, 200+ recipes and more. They are also certified in Nutrition Science by Stanford University.\r\n\r\nAlmost Plant Based are offering $10 off their program. Please note, their website charges in USD.',	14,	'ajZjqg8GD4PMY6ZXYI9XSt9i3crxdmvYhficfold.png',	78,	'Use code TDG10$OFF at checkout',	'2021-01-20 11:42:34',	1,	'2021-01-20 11:42:34',	'2021-01-25 07:08:22'),
(104,	'10% Off Cakes',	'Cake Social is a boutique cake and dessert shop based in Dubai that promises to make every moment sweeter. Along with your everyday cakes and bakes, they specialize in customized 3D cakes where the words stylish and delicious are inseparable. At Cake Social, they believe people should celebrate events, moments, and life as often as possible. Their specialists are available every day to help our “Socials” realize their vision. You dream it, they bake it!\r\n\r\nCake Social are offering a 10% discount on non-seasonal products with orders above AED 100 to all TDG members.\r\n\r\nAll customized cakes require 1 to 3 days prior booking subject to confirmation. All orders after 7.00 pm are considered as the next day.',	13,	'ylusTTfGshXIXMWHAAbodGiLNivakJkjgAZOKSS1.png',	80,	'Present ID to redeem discount',	'2021-01-21 06:19:38',	1,	'2021-01-21 06:19:38',	'2021-01-27 07:23:30'),
