(106,	'Special Discount',	'No mess, no stress! The Movers DXB help people and businesses move their goods from one place to another. They offer all-inclusive services for relocation like packing, loading, moving, unloading, unpacking, arranging of items to be shifted. Additional services may include cleaning services for houses, offices or warehousing facilities. They are specialized in providing quality-oriented services. They have well experienced packers & movers to provide best services.\r\n\r\nThe Movers DXB are offering a special discount to all TDG members. Please quote TDG at the time of booking.',	13,	'EaBGK9FdYdZAZRnOoK4TABny9Ai9DbBHQr4L76Ex.png',	81,	'Present ID to redeem discount',	'2021-01-21 06:34:05',	1,	'2021-01-21 06:34:05',	'2021-01-25 07:02:49'),
(107,	'Ladies Night Package',	'Work your way around the world amid the bustle and energy of this eclectic dining destination. Sample sizzling dishes and bold flavours from Asia at Kim’s Korean, Lucy Wong’s, Momo San and Chatakana; indulge in Italian favourites at Mario’s and Arabic delicacies at Ali’s. Drink and dine with views of the Burj Khalifa and Dubai’s stunning skyline.\r\n\r\n24th St. World Street Food are offering an exclusive TGD Ladies Night, Saturday\'s through Monday\'s.\r\n\r\nAED109 – one main course and unlimited wine from 8pm to 10pm             \r\nAdd AED49 to enjoy dessert and unlimited house spirits; beer from 8pm to 10pm',	5,	'RzV7oWeGKqoNe0UjegN5lCyQaKNXNb2ptGLf2lq5.png',	93,	'Present ID to redeem discount',	'2021-01-21 12:20:55',	1,	'2021-01-21 12:20:55',	'2021-01-25 07:02:39'),
(108,	'Brunch Package',	'Dine in Thai style with views of Burj Khalifa and Dubai’s glittering skyline. Experience an authentic culinary journey focused on the freshest ingredients, harmony and balance of flavours, and exquisite presentation.\r\n\r\nBenjarong are offering a discounted brunch package for all TGD members every Friday.\r\n\r\nAED 169 per person (food & soft drinks only) from the original price of AED220 per person',	5,	'tOsEzx36tqAWyw1f6lP1SXutK1j64O8WDkWZvUR3.png',	96,	'Present ID to redeem discount',	'2021-01-21 12:30:57',	1,	'2021-01-21 12:30:57',	'2021-01-25 07:04:43'),
(109,	'Happy Hour All Night',	'Experience the unique drinking culture of Japan and explore its 100-year-old history at Nippon Bottle Company, where the legacy lives on. Discover the unmistakable textures and blends of Japanese beers and whiskies for a journey of flavours.\r\n\r\nNippon Bottle Company are offering an exclusive Ladies Night for all TDG members, Saturday\'s through Monday\'s.\r\n\r\nHappy hour all night @ AED 29 per drink (house beverages only)',	5,	'vROrzOPTTLoOfHLaCwyCN5Pd91GADvO0YczACUl7.png',	95,	'Present ID to redeem discount',	'2021-01-21 12:33:56',	1,	'2021-01-21 12:33:56',	'2021-01-25 07:04:51'),
(110,	'Ladies Night Package',	'Aptly named for its prime location between Dubai’s soaring skyscrapers, View offers panoramic vistas of the skyline. Whet your appetite with an array of delicious drinks and indulge with bites and delights from Jones the Grocer. Watch the sunset Emirati style, with an aromatic shisha.\r\n\r\nView are offering an exclusive Ladies Night to all TDG members, Saturday\'s through Monday\'s.\r\n\r\nAED109 – one main course and shisha            \r\nAdd AED99 to enjoy unlimited wine for two hours',	5,	'iGFy7Pz2R59TDh300GxUBmy6tIhbbh0f96JCD1SK.png',	94,	'Present ID to redeem discount',	'2021-01-21 12:38:30',	1,	'2021-01-21 12:38:30',	'2021-01-25 07:05:01'),
(122,	'15% Off Merchandise',	'Pet Parents UAE is a community founded in July 2019 by a dog mum wanting to form new friendships for herself and her dogs. From events to simple meet ups they have always had dog parents of Dubai in their best interests, alongside their local dog organtisations raising just over 10,000AED in 1 year alone.\r\nTheir merchandise is designed to help you and your family stand out from the crowd but also be recognized as part of a community. With every purchase made they will donate 15% towards a different organizations vet bill each month. Like their events, they will always thrive to give you the best and most friendliest service.\r\n\r\nPet Parents UAE are offering 15% off for all TDG members.',	3,	'IKYr60NHOCOKVcxUt4tZ6jiAAi8OM8B0W6DcAk35.png',	98,	'Use code TDG15 at checkout',	'2021-01-25 07:18:09',	1,	'2021-01-25 07:18:09',	'2021-01-25 07:18:09'),
(123,	'10% Off Orders',	'Print Outs is an ambitious pursuit of excellence in the field of design, print and event management with over 12 years in the corporate world. Print Outs was born with the explicit purpose to help brands come alive and connect with their audience. They address and manage any quantity of print requirements, on a wide gamut of media. All forms of cards, invitations, flyers, brochures, backdrops, posters, banners, boxes, stickers, cut outs, signages, office stationery, calendars and gift items. They consistently exceed the expectations of their clients by delivering high quality, innovative and inspiring work.\r\n\r\nPrint Outs are offering 10% off orders over 150 AED.',	13,	'wKUGHypUrsH3KQKLRgYWrGqSjpFs1mg5dFmlSGxF.jpeg',	97,	'Present ID to redeem discount',	'2021-01-25 07:22:28',	1,	'2021-01-25 07:22:28',	'2021-01-25 07:22:28'),
(124,	'15% Off Orders',	'Manaiza\'s is a haute couture dubai based brand. They work with all kinds of dresses including evening gowns, bridal gowns, formal and casual wear.\r\nThey are also offer customized dresses!\r\n\r\nManaiza\'s are offering 15% off all orders (including customized dresses) to all TDG members.',	3,	'oe1EfnMjUOOGoZxMrEalSypT8P6LP347uouU8DIG.png',	99,	'Present ID to redeem discount',	'2021-01-25 07:29:51',	1,	'2021-01-25 07:29:51',	'2021-01-25 07:29:51'),
(125,	'10% Off Prepaid Deliveries',	'Errand Runners offers end-to-end fulfilment and delivery services to e-commerce businesses and individuals. Based in Bur Dubai, they have clients across the seven emirates of the UAE. They also provide storage and logistics services to a range of business sectors.\r\n\r\nErrand Runners are offering 10% off a package of 10 prepaid deliveries.',	13,	's6P6qLJDgyzU4cDgTSvPXchxkkwrJWHpdBhzcMwa.png',	100,	'Present ID to redeem discount',	'2021-01-25 09:46:29',	1,	'2021-01-25 09:46:29',	'2021-01-25 09:46:29'),
(126,	'Mum\'s - This One\'s For You!',	'Chaps & Co is a no-nonsense men’s barbershop in Dubai where a man can be a man, sit down, get an ice cold drink and chat during a clean haircut and a straight razor shave.\r\n \r\nSend your little man and big man for a fresh trim! Chaps & Co are offering Dad & Lad Haircuts at any of their branches for 180 AED (discounted from 180 AED). Valid any time or day of the week!',	2,	'C0sh8TL7Lf6CBpwjRsN4fk3saQVIX3KJeIC3ko9c.png',	76,	'Present ID to redeem discount',	'2021-01-26 06:34:02',	1,	'2021-01-26 06:34:02',	'2021-01-26 06:34:02'),
(130,	'Sip + Shop Event',	'Join us for an evening of sipping and shopping at Qwerty Bar in Media One Hotel from 6pm on Tuesday 2nd February. \r\n\r\nEnjoy a complimentary glass of wine on arrival and a TDG goodie bag by showing your TDG membership card! Then shop your favourite local brands in the pop-up market. You can also choice to enjoy the additional deal of 3 drinks and a main meal for 99 AED! Contact Qwerty directly to book a table or walk-in if you’d simply like to enjoy the Sip + Shop!',	5,	'xamgQ8biHoQCj2q4LW1AAaMEDiJRZGqrNIKOUfbX.png',	104,	'Sip + Shop Complimentary Drink',	'2021-01-26 07:44:51',	2,	'2021-01-26 07:44:51',	'2021-01-26 07:45:49'),
(131,	'50% Off Blowdry\'s With Every Facial',	'Pastels Salon is an award-winning hair, nails and beauty salon in Dubai. With a flagship Ladies-only branch located in the heart of Jumeirah and a second upbeat unisex branch located in The Ritz Carlton, JBR, Pastels is a go-to for the city’s most influential beauty editors, socialites, influencers and beauty lovers, offering the world’s most acclaimed hair, beauty, facial &amp; nail treatments. The salon’s highly-skilled international team of hairstylists, beauticians and nail technicians will exceed your expectations at every visit.\r\n\r\nPastels Salon are offering 50% off a blowdry when you have a facial to all TDG members, valid every day!',	2,	'RSgqzLwhvLlxkOyoQAm8TBUR7fzDBhLImiGtxvOa.png',	102,	'Present ID to redeem discount',	'2021-01-26 07:46:55',	1,	'2021-01-26 07:46:55',	'2021-01-26 07:46:55'),
(132,	'50% Off Blowdry\'s With Every Facial',	'Pastels Salon is an award-winning hair, nails and beauty salon in Dubai. With a flagship Ladies-only branch located in the heart of Jumeirah and a second upbeat unisex branch located in The Ritz Carlton, JBR, Pastels is a go-to for the city’s most influential beauty editors, socialites, influencers and beauty lovers, offering the world’s most acclaimed hair, beauty, facial &amp; nail treatments. The salon’s highly-skilled international team of hairstylists, beauticians and nail technicians will exceed your expectations at every visit.\r\n\r\nPastels Salon are offering 50% off a blowdry when you have a facial to all TDG members, valid every day!',	2,	'h9zPVmY7Ye4KKrrWrqRy14yGcmUnGMovAjFs9GPm.png',	103,	'Present ID to redeem discount',	'2021-01-26 07:47:39',	1,	'2021-01-26 07:47:39',	'2021-01-26 07:47:39'),
(133,	'15% Off Selected Nail And Waxing',	'Pastels Salon is an award-winning hair, nails and beauty salon in Dubai. With a flagship Ladies-only branch located in the heart of Jumeirah and a second upbeat unisex branch located in The Ritz Carlton, JBR, Pastels is a go-to for the city’s most influential beauty editors, socialites, influencers and beauty lovers, offering the world’s most acclaimed hair, beauty, facial &amp; nail treatments. The salon’s highly-skilled international team of hairstylists, beauticians and nail technicians will exceed your expectations at every visit.\r\n\r\nPastels Salon are offering 15% off selected nail and waxing treatments on Sunday\'s and Monday\'s to all TDG members.',	2,	'qTt3RCQWFyztRVWAzBHVoSZ3toMYGJlJIleUSNZD.png',	102,	'Present ID to redeem discount',	'2021-01-26 07:59:34',	1,	'2021-01-26 07:59:34',	'2021-01-26 07:59:34'),
(134,	'15% Off Selected Nail And Waxing',	'Pastels Salon is an award-winning hair, nails and beauty salon in Dubai. With a flagship Ladies-only branch located in the heart of Jumeirah and a second upbeat unisex branch located in The Ritz Carlton, JBR, Pastels is a go-to for the city’s most influential beauty editors, socialites, influencers and beauty lovers, offering the world’s most acclaimed hair, beauty, facial &amp; nail treatments. The salon’s highly-skilled international team of hairstylists, beauticians and nail technicians will exceed your expectations at every visit.\r\n\r\nPastels Salon are offering 15% off selected nail and waxing treatments on Sunday\'s and Monday\'s to all TDG members.',	2,	'su8LH4xL1zVsiZR1jOZ6EBwNUpyJN2zUFZhzY7KL.png',	103,	'Present ID to redeem discount',	'2021-01-26 08:01:45',	1,	'2021-01-26 08:01:45',	'2021-01-26 08:01:45'),
(135,	'15% Off Fillers and Botox',	'Led by a team of experienced plastic surgeons, dermatologists and beauty experts, the principal aim of the clinic is to make you feel beautiful and confident in your own skin. The clinic’s extensive range of aesthetic treatments includes cosmetic and plastic surgery procedures, as well as dermatology and laser skin treatments to enhance your appearance, ensuring you will feel as beautiful on the outside as you are on the inside! Offering the most advanced methods of aesthetic improvements, the clinic is renowned as one of the leading Cosmetic and Plastic Surgery Clinics in Dubai today.\r\n\r\nDr Kayle Aesthetic Clinic are offering 15% off fillers and botox to all TDG members.',	2,	'9NPyvFDkcUac2BTCX2YslvF6PPGLRSFAw4Dask4j.png',	101,	'Present ID to redeem discount',	'2021-01-26 08:07:13',	1,	'2021-01-26 08:07:13',	'2021-01-26 08:07:13'),
(136,	'10-15% Off Cosmetic Surgery',	'Led by a team of experienced plastic surgeons, dermatologists and beauty experts, the principal aim of the clinic is to make you feel beautiful and confident in your own skin. The clinic’s extensive range of aesthetic treatments includes cosmetic and plastic surgery procedures, as well as dermatology and laser skin treatments to enhance your appearance, ensuring you will feel as beautiful on the outside as you are on the inside! Offering the most advanced methods of aesthetic improvements, the clinic is renowned as one of the leading Cosmetic and Plastic Surgery Clinics in Dubai today.\r\n\r\nDr Kayle Aesthetic Clinic are offering TDG members 10-15% off cosmetic surgery procedures (dependent on procedure - cost given at time of consultation).',	2,	'MP8B9IgSqvxgkOYY2LEN4dT4ETvJvdNeav1n6hvn.png',	101,	'Present ID to redeem discount',	'2021-01-26 08:09:27',	1,	'2021-01-26 08:09:27',	'2021-01-26 08:09:27'),
(139,	'250 AED Off',	'Accessories Club is UAE\'s newest online jewellery boutique. Their team has over 25 years sourcing the world\'s best jewels and we offer a collection of fabulous, affordable sterling silver jewellery all candy coated in rose, white or yellow gold for a shimmer and shine that will last a lifetime. \r\n\r\nAccessories Club are offering 250 AED off all purchase\'s of 500 AED and above to all TDG members.',	3,	'5ERq0WVoBmDfWE5YjzaVdn6A0djthQXszybeUgPV.png',	105,	'Use code 143TDG at checkout',	'2021-01-26 11:40:38',	1,	'2021-01-26 11:40:38',	'2021-01-26 11:56:50'),
(140,	'500 AED Off PT Packages',	'XMPT Fitness is a personal training, sports coaching & dance class provider. Established in 2019 it’s your one stop shop for all things health & fitness, providing training for all fitness levels. They offer a range of services including pre & post natal training, health & nutrition advice, sport specific coaching, adult dance fitness classes, children’s dance classes, sports massage & more. Get ready to tear down obstacles of the mind and body. At XMPT they believe that getting back to work means setting your own pace. So start your journey with XMPT fitness today. \r\n\r\nXMPT Fitness are offering 500AED off 10 Personal training session packages to all TDG members.',	14,	'ECPujSrXpeBREf8nb6emXfT4QQwv0CzpyTTAbL0q.png',	47,	'Present ID to redeem discount',	'2021-01-27 06:06:17',	1,	'2021-01-27 06:06:17',	'2021-01-27 06:06:17'),
(142,	'Free L\'Oreal Treatment With Every Blowdry',	'Pastels Salon is an award-winning hair, nails and beauty salon in Dubai. With a flagship Ladies-only branch located in the heart of Jumeirah and a second upbeat unisex branch located in The Ritz Carlton, JBR, Pastels is a go-to for the city’s most influential beauty editors, socialites, influencers and beauty lovers, offering the world’s most acclaimed hair, beauty, facial & nail treatments. The salon’s highly-skilled international team of hairstylists, beauticians and nail technicians will exceed your expectations at every visit.\r\n\r\nPastels Salon are offering a complimentary L’Oreal treatment (worth 110 AED) with every blow dry, Sunday – Tuesday.',	2,	'HZeCayLZ5wcFd0Jw4b5wqGcKedy5zqiYuyy26s5L.png',	102,	'Present ID to redeem discount',	'2021-01-27 06:11:06',	1,	'2021-01-27 06:11:06',	'2021-01-27 06:11:06'),
(143,	'40% Off All Purchases',	'Nola By Gala offer all-natural eco-lux cosmetics that focus on hair growth solutions and skincare. Delivery is completely free and have a returns policy with 100% refund available.\r\n\r\nNola By Gala are offering 40% off purchases for all TDG members.',	3,	'8rPqHZD7GJjyOAPnOgTFrWkqtw3uKCbJrO6ukI2j.png',	106,	'Present ID to redeem discount',	'2021-01-27 06:20:51',	1,	'2021-01-27 06:20:51',	'2021-01-27 11:19:08'),
(144,	'20% Off Purchases',	'Fierce Femme is a women\'s clothing brand for the bold and fearless. Sourcing fabrics locally and handmaking the designs here in Dubai creates a sustainable and unique collection exclusive to Fierce Femme. Fierce Femme can custom make their exclusive collection to fit any size.\r\n\r\nFierce Femme are offering 20% off to all TDG members.',	3,	'lm4IgzeGvejqDgEruueweIbnCcgq2qMTJpCzFQL4.png',	107,	'Use code TDG20 at checkout',	'2021-01-27 07:57:42',	1,	'2021-01-27 07:57:42',	'2021-01-27 08:34:38'),
(145,	'Free L\'Oreal Treatment With Every Blowdry',	'Pastels Salon is an award-winning hair, nails and beauty salon in Dubai. With a flagship Ladies-only branch located in the heart of Jumeirah and a second upbeat unisex branch located in The Ritz Carlton, JBR, Pastels is a go-to for the city’s most influential beauty editors, socialites, influencers and beauty lovers, offering the world’s most acclaimed hair, beauty, facial & nail treatments. The salon’s highly-skilled international team of hairstylists, beauticians and nail technicians will exceed your expectations at every visit.\r\n\r\nPastels Salon are offering a complimentary L’Oreal treatment (worth 110 AED) with every blow dry, Sunday – Tuesday.',	2,	'vKmGXYjx4ymFaIyK0Gn8AwxS45VInLoePfBi7ec1.png',	103,	'Present ID to redeem discount',	'2021-01-27 08:22:33',	1,	'2021-01-27 08:22:33',	'2021-01-27 08:22:54'),
(146,	'10% Off Purchases',	'Shea Good is a luxury shea butter brand that is created from raw organic African shea butter which is renowned for its anti-inflammatory and healing properties amongst many other benefits. Shea Good have taken a traditional product, which has been used for centuries, and melodically infused it with essential oils and fragrances to produce distinctive scents. Their focus is not only on the outer but more significantly the inner, and it is of fundamental importance to create their products as naturally as possible. They have created this product with only you in mind, wanting you to look, smell and feel as luxurious as their product. \r\n\r\nShea Good are offering 10% off full price items to all TDG members.',	3,	'enCdhNaBk8Xk4fNKC6ZakEFu4TpEwMbwEHaU1EuG.png',	108,	'Use code ThatDG10 at checkout',	'2021-01-27 09:20:54',	1,	'2021-01-27 09:20:54',	'2021-01-27 09:20:54'),
(147,	'20% Off Dine In',	'Spill the Bean is an independent specialty coffee shop focused on single origin coffees from different areas around the world, healthy home-made comfort food made from scratch, and the community around us. Watch it become the local neighborhood coffee shop you find yourself frequenting regularly- even if you\'re not in the neighborhood! \r\n\r\nSpill the Bean are offering 20% off their dine in menu to all TDG members.',	5,	'7XTD0L9E9Kb6a9GLgxIwci8Kqrj7nhhM7qHU1QpX.jpeg',	111,	'Present ID to redeem discount',	'2021-01-28 07:22:04',	1,	'2021-01-28 07:22:04',	'2021-01-28 07:22:04'),
(148,	'15% Off Everything',	'Neon Starfish provide gorgeous fashion hand made in Dubai. Everyone’s favourite go-to brand to look effortlessly great! Shop online or in the Marina Mall flagship store. \r\n\r\nNeon Starfish are offering 15% off everything in their Marina Mall store and online to all TDG members.',	3,	'BSqIJQPvD4DSR1cvBhyz01FiKpV5wIbMOWAvWova.jpeg',	112,	'Use code TDG15 at checkout',	'2021-01-28 07:44:59',	1,	'2021-01-28 07:44:59',	'2021-01-28 07:44:59'),
(149,	'25% Off Photo Books',	'Instorya is a mobile app that turns your happy memories into an amazing photo book without breaking the bank. Preserve your happy memories for the next generation to come! If you are in Dubai, they are happy to deliver your photo book within 3 working days.\r\n\r\nInstorya are offering 25% off on their Simple Photo books to all TDG members.',	3,	'ahNz0y2192DWSbixTB3hNXSudCW2x8spk0YofbOX.png',	113,	'Use code TDG25 at checkout',	'2021-01-28 10:27:17',	1,	'2021-01-28 10:27:17',	'2021-01-28 11:34:05');
